PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE objects (
 "id" integer primary key autoincrement,
  object_id TEXT UNIQUE,
  ra REAL,
  dec REAL, 
  magnitude REAL,
  angular_size REAL,
  type INTEGER
  );
CREATE TABLE denominations (objects_id TEXT references objects(id), catalogue TEXT, number INTEGER, name TEXT, comment TEXT);
COMMIT;
